CREATE VIEW [Ventas].[v_Pedidos]
WITH SCHEMABINDING 
AS
SELECT        Ventas.Pedidos.id_pedido AS ID, Ventas.Pedidos.codigo AS CÓDIGO, Ventas.Clientes.nombre_cliente AS CLIENTE, Ventas.Transportistas.nombre_empresa AS TRANSPORTE, 
                         RecursosHumanos.Empleados.apellido_empleado + ', ' + RecursosHumanos.Empleados.nombre_empleado AS RESPONSABLE, Ventas.Pedidos.fecha_ordenado AS ORDENADO, 
                         Ventas.Pedidos.fecha_requerido AS REQUERIDO, Ventas.Pedidos.fecha_entregado AS ENTREGADO, Ventas.Pedidos.costo_envio AS [COSTO DE ENVÍO]
FROM            Ventas.Pedidos INNER JOIN
                         Ventas.Clientes ON Ventas.Pedidos.id_cliente = Ventas.Clientes.id_cliente INNER JOIN
                         RecursosHumanos.Empleados ON Ventas.Pedidos.id_empleado = RecursosHumanos.Empleados.id_empleado INNER JOIN
                         Ventas.Transportistas ON Ventas.Pedidos.id_transportista = Ventas.Transportistas.id_transportista AND Ventas.Pedidos.id_transportista = Ventas.Transportistas.id_transportista
GO
