CREATE PROCEDURE [Reportes].[Top10Clientes]
@FechaInicial AS DATETIME,
@FechaFinal AS DATETIME
AS
BEGIN
SET NOCOUNT ON
SELECT TOP(10) nombre_cliente AS CLIENTE, 
ROUND(SUM((precio_unitario - ((descuento/100.00) * precio_unitario)) * cantidad),1) AS SALDO
FROM Ventas.Pedidos AS VP
INNER JOIN Ventas.PedidoDetalles AS VPD
ON VP.id_pedido = VPD.id_pedido
AND fecha_ordenado BETWEEN @FechaInicial AND @FechaFinal
INNER JOIN Ventas.Clientes AS VC
ON VP.id_cliente = VC.id_cliente 
GROUP BY nombre_cliente
ORDER BY SALDO DESC
END;

