CREATE PROCEDURE [Ventas].[EditarPedido]
@Id_Pedido INT,
@Nombre_Cliente VARCHAR(55),
@Nombre_Transporte VARCHAR(55),
@Nombre_Empleado VARCHAR(55),
@Fecha_Ordenado DATETIME,
@Fecha_Requerido DATETIME = NULL,
@Fecha_Entregado DATETIME = NULL,
@Costo_Envio MONEY
AS
BEGIN
SET NOCOUNT ON
DECLARE 
@Id_Cliente INT,
@Id_Transporte INT,
@Id_Empleado INT

DELETE FROM Ventas.PedidoDetalles
WHERE id_pedido = @Id_Pedido;

SET @Nombre_Empleado = NULLIF(RTRIM(LTRIM(@Nombre_Empleado)),'');

SET @Id_Cliente = (SELECT id_cliente FROM Ventas.Clientes
					 WHERE nombre_cliente = NULLIF(RTRIM(LTRIM(@Nombre_Cliente)),''));
SET @Id_Transporte = (SELECT id_transportista FROM Ventas.Transportistas
					 WHERE nombre_empresa = NULLIF(RTRIM(LTRIM(@Nombre_Transporte)),''));
SET @Id_Empleado = (SELECT id_empleado FROM RecursosHumanos.Empleados
					 WHERE @Nombre_Empleado = apellido_empleado + ', ' + nombre_empleado);
IF @Id_Cliente IS NOT NULL OR @Id_Transporte IS NOT NULL OR @Id_Empleado IS NOT NULL
BEGIN
UPDATE Ventas.Pedidos 
SET id_cliente = @Id_Cliente,
id_transportista = @Id_Transporte,
id_empleado = @Id_Empleado,
fecha_ordenado = NULLIF(RTRIM(LTRIM(@Fecha_Ordenado)),''),
fecha_requerido = NULLIF(RTRIM(LTRIM(@Fecha_Requerido)),''),
fecha_entregado = NULLIF(RTRIM(LTRIM(@Fecha_Entregado)),''),
costo_envio = NULLIF(RTRIM(LTRIM(@Costo_Envio)),'')
WHERE id_pedido = @Id_Pedido
END
ELSE
BEGIN
RAISERROR('No se pudo editar el pedido. El cliente, transportista o empleado no existe.',16,1);
END
END
