CREATE PROCEDURE [Ventas].[MostrarPedidosEntregados]
@NumeroPagina INT,
@RegistrosPorPagina INT
AS
BEGIN
SET NOCOUNT ON
SELECT [ID], [CÓDIGO], [CLIENTE], [TRANSPORTE], [RESPONSABLE], [ORDENADO], [ENTREGADO], [COSTO DE ENVÍO]
FROM Ventas.v_Pedidos
WHERE [ENTREGADO] IS NOT NULL
ORDER BY [ENTREGADO] DESC, [CÓDIGO] DESC
OFFSET (@NumeroPagina - 1) * @RegistrosPorPagina ROWS
FETCH NEXT @RegistrosPorPagina ROWS ONLY
END;

