CREATE PROCEDURE [Ventas].[MostrarPedidosPendientes]
@NumeroPagina INT,
@RegistrosPorPagina INT
AS
BEGIN
SET NOCOUNT ON
SELECT [ID], [CÓDIGO], [CLIENTE], [TRANSPORTE], [RESPONSABLE], [ORDENADO], [REQUERIDO], [COSTO DE ENVÍO]
FROM Ventas.v_Pedidos
WHERE [ENTREGADO] IS NULL
