CREATE PROCEDURE [Ventas].[MostrarTransportistas]
@NumeroPagina INT,
@RegistrosPorPagina INT
AS
BEGIN
SET NOCOUNT ON
SELECT [id_transportista] AS [ID],[codigo] AS [CÓDIGO], [nombre_empresa] AS [NOMBRE], [direccion] AS [DIRECCIÓN], 
[ciudad] AS [CIUDAD], [region] AS [REGIÓN], [pais] AS [PAÍS], [telefono] AS [TELÉFONO]
FROM Ventas.Transportistas
ORDER BY [NOMBRE], [ID]
OFFSET (@NumeroPagina - 1) * @RegistrosPorPagina ROWS
FETCH NEXT @RegistrosPorPagina ROWS ONLY
END;
